import React from 'react';
import './Sidebar.css';
import explogo from './img/explogo.png';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faHome, faTachometer, faLaptop, faUsers, faSliders} from '@fortawesome/free-solid-svg-icons';

    const Sidebar = () => {
      return (
        <div className="sidebar">
          <div className="logo"><img src={explogo} alt="explogo" className="logo-img"/></div>
          <h2>ASSET <br/>MANAGEMENT</h2>
            <h3>
            <FontAwesomeIcon icon={faHome} />MENU</h3>
            <hr />
          <ul>
            <li className={location.pathname === '/dashboard' ? 'active' : ''}>
          <Link to="/dashboard">
          <FontAwesomeIcon icon={faTachometer} />DASHBOARD</Link>
          </li>
            <li className={location.pathname === '/assets' ? 'active' : ''}>
          <Link to="/assets">
          <FontAwesomeIcon icon={faLaptop} /> ASSETS</Link>
          </li>
            <li className={location.pathname === '/custodians' ? 'active' : ''}>
          <Link to="/custodians">
          <FontAwesomeIcon icon={faUsers} />CUSTODIANS</Link>
          </li>

            <li className={location.pathname === '/settings' ? 'active' : ''}>
          <Link to="/settings">
          <FontAwesomeIcon icon={faSliders} />SETTINGS</Link>
          </li>

          </ul>
        </div>
      );
    };

    export default Sidebar;
